tables.table_schema:
CREATE TABLE biomechanical_properties (
   material_id INT PRIMARY KEY,
   material_name VARCHAR(255) NOT NULL,
   density FLOAT NOT NULL,
   elasticity FLOAT NOT NULL
);

CREATE TABLE biomechanical_properties_of_materials (
  material_id INT PRIMARY KEY,
  material_name VARCHAR(255) NOT NULL,
  elasticity FLOAT,
  strength FLOAT
);

CREATE TABLE prosthetics_info (
  prosthetic_id INT PRIMARY KEY,
  prosthetic_type VARCHAR(255) NOT NULL,
  material_id INT,
  FOREIGN KEY (material_id) REFERENCES biomechanical_properties_of_materials(material_id)
);

CREATE TABLE prosthetic_parts (
  part_id UUID PRIMARY KEY,
  part_name STRING NOT NULL,
  material_id UUID NOT NULL,
  weight FLOAT NOT NULL
);
